import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import AnalysisBoard from './AnalysisBoard';
import './styles.css';

const AnalysisBoardPage = () => {
    const [orientation, setOrientation] = useState('white');
    const [fen, setFen] = useState('rnbqkbnr/pppppppp/8/8/8/8/PPPPPPPP/RNBQKBNR w KQkq - 0 1'); // Define the FEN state and its setter function
    const [isLogoHovered, setIsLogoHovered] = useState(false);

    return (
        <div className="landing-page">
            <header>
                <nav>
                    <ul>
                        <li onMouseEnter={() => setIsLogoHovered(true)}
                            onMouseLeave={() => setIsLogoHovered(false)}>
                            <Link to="/">
                                <img src={isLogoHovered ? logoWhite : logo} alt="Home" style={{height: '40px' }} />
                            </Link>
                        </li>
                        <li className='highlighted' style={{ color: '#F7B26A'}}><Link to="/">Prepare</Link></li>
                        <li><Link to="/analysis-board">Analysis Board</Link></li>
                        <li><Link to="#import-games">Import Games</Link></li>
                        <li><Link to="#about-us">About Us</Link></li>
                    </ul>
                </nav>
            </header>

            <main>
                <div>
                    <AnalysisBoard>{({evaluation, bestLine, goToEnd, goToNextMove, goToPreviousMove, goToStart, fen}) => (
                        <div>
                            <button onClick={goToStart}>Start</button>
                            <button onClick={goToPreviousMove}>Previous</button>
                            <button onClick={goToNextMove}>Next</button>
                            <button onClick={goToEnd}>End</button>
                            <div>
                                <div>Stockfish Eval: {evaluation}</div>
                                <div>Best Continuation Line: {bestLine}</div>
                            </div>
                            </div> 
                    )}</AnalysisBoard>
                    </div>

            </main>
            <footer>
                <p>&copy; 2024 SquareChess. All rights reserved.</p>
            </footer>
        </div>
    );
};

export default AnalysisBoardPage;
